// Get the incoming JSON from previous node
const inputData = items[0].json;

// Parse the AI output (it's already JSON)
const aiOutput = Array.isArray(inputData) ? inputData[0] : inputData;

// Helper function to format sections
function formatSection(title, content) {
  return `
    <h2 style="color:#1a73e8;">${title}</h2>
    <p style="white-space:pre-wrap;">${content || '—'}</p>
  `;
}

const htmlBody = `
<!DOCTYPE html>
<html>
<head>
<meta charset="UTF-8">
<title>CEO Personal Branding Posts</title>
<style>
  body { font-family: Arial, sans-serif; background-color: #f4f6f8; margin: 0; padding: 0; }
  .email-container {
    max-width: 650px;
    background-color: #ffffff;
    margin: 30px auto;
    padding: 25px;
    border-radius: 10px;
    box-shadow: 0px 3px 10px rgba(0,0,0,0.08);
    color: #333333;
    line-height: 1.6;
  }
  h1 { color: #1a73e8; font-size: 22px; margin-bottom: 15px; }
  p { font-size: 15px; margin-bottom: 15px; }
  .footer { font-size: 13px; color: #888888; margin-top: 20px; text-align: center; }
</style>
</head>
<body>
  <div class="email-container">
    <h1>CEO Personal Branding Content</h1>
    ${formatSection("LinkedIn Post", aiOutput.linkedin)}
    ${formatSection("Instagram Post", aiOutput.instagram)}
    ${formatSection("Twitter Post", aiOutput.twitter)}
    <div class="footer">Sent via n8n Automation</div>
  </div>
</body>
</html>
`;

return [{
  json: {
    subject: "CEO Personal Branding Posts",
    htmlBody
  }
}];

// Get raw AI output
const rawOutput = $json.output;

// Parse the string into a JSON object
let parsedOutput;
try {
  parsedOutput = JSON.parse(rawOutput);
} catch (error) {
  throw new Error("Invalid JSON string in 'output': " + error.message);
}

// Return structured data
return [
  {
    json: {
      linkedin: parsedOutput.linkedin || null,
      instagram: parsedOutput.instagram || null,
      twitter: parsedOutput.twitter || null
    }
  }
];
